import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [file, setFile] = useState(null);
  const [status, setStatus] = useState('Idle');
  const [assetID, setAssetID] = useState('');
  const apiToken = 'eyJhbGciOiJSUzI1NiIsInR5cCIgOiAiSldUIiwia2lkIiA6ICJuSnVpYzVwbXk1T1hGSjVmY1RIQTdUNVktRHZVbVVOR2xxVHBqS0hDVnU4In0..H1HFLueZM-jehJbuwKJ8HdMAUAILY5Ao5J5OyrK3ITE58l5d2JccK21KHy4NL-CZOvqqSxMvd0d_M7UFb4UU_sqKi25BP_nHHViXUxeCjFPTJJTVVwWTLB0b2yLsvEalEIhWXVcV4wPFCP0UqGk6Ud35bFlSzPkQmtwStLLZGq0cFCZoihf8-FZ6UMFWxF8s8eZ8Ub-WzCoiQn_8UBQqdC50LeiSpjwflIwj5GYpickLIUPS0bNC0jopq9Tpahlf0QuIhHXzNLjOot745KMCBYTaqiyhimjiZQ2YTksk_G1c8WLUO9KafnUmLAltThs0GKWFsMtVmDSGDH0m_w918w'; // Place your API token here

  const handleFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  const createAvatar = async () => {
    setStatus('Creating Avatar...');
    try {
      const response = await axios.post('https://api.meshcapade.com/api/v1/avatars/create/from-images', {}, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
      });
      // Ensure the response contains the expected data
      if (response.data && response.data.id) {
        const newAssetID = response.data.id;
        setAssetID(newAssetID);
        setStatus('Avatar Created');
        return newAssetID;
      } else {
        // Handle unexpected response structure
        console.error('Unexpected response structure:', response);
        setStatus('Error Creating Avatar: Unexpected response structure');
        return null;
      }
    } catch (error) {
      console.error('Error creating avatar:', error);
      setStatus('Error Creating Avatar');
      return null;
    }
  };

  const uploadImage = async (assetID) => {
    setStatus('Uploading Image...');
    const formData = new FormData();
    formData.append('file', file);

    try {
      const response = await axios.post(`https://api.meshcapade.com/api/v1/avatars/${assetID}/images/upload`, formData, {
        headers: {
          'Authorization': `Bearer ${apiToken}`,
          'Content-Type': 'multipart/form-data',
        },
      });
      // Check if the upload was successful based on the API's success response
      if (response.status === 200) { // Adjust this condition based on the API's actual success criteria
        setStatus('Image Uploaded');
        return true;
      } else {
        console.error('Error uploading image: Unexpected response', response);
        setStatus('Error Uploading Image: Unexpected response');
        return false;
      }
    } catch (error) {
      console.error('Error uploading image:', error);
      setStatus('Error Uploading Image');
      return false;
    }
  };

  const startFittingProcess = async (assetID) => {
    setStatus('Starting Fitting Process...');
    try {
      const response = await axios.post(`https://api.meshcapade.com/api/v1/avatars/${assetID}/fit-to-images`, {}, {
        headers: { 'Authorization': `Bearer ${apiToken}` },
      });
      // Check response to ensure the fitting process started successfully
      if (response.status === 200) { // Adjust this condition based on the API's actual success criteria
        setStatus('Fitting Process Started');
        return true;
      } else {
        console.error('Error starting fitting process: Unexpected response', response);
        setStatus('Error Starting Fitting Process: Unexpected response');
        return false;
      }
    } catch (error) {
      console.error('Error starting fitting process:', error);
      setStatus('Error Starting Fitting Process');
      return false;
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (!file) {
      alert('Please select a file.');
      return;
    }

    const createdAssetID = await createAvatar();
    if (createdAssetID) {
      const imageUploaded = await uploadImage(createdAssetID);
      if (imageUploaded) {
        await startFittingProcess(createdAssetID);
        // Implement polling or a callback mechanism here to check the status of the fitting process
      }
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input type="file" onChange={handleFileChange} />
        <button type="submit">Upload and Create Avatar</button>
      </form>
      <div>Status: {status}</div>
      {assetID && <div>Asset ID: {assetID}</div>}
    </div>
  );
}

export default App;
